import { createSlice } from "@reduxjs/toolkit";

import Product from "../models/Product";

const stockSlice = createSlice({
    name: "stock",
    initialState: [
        new Product("Paleta fresa", "data:image/jpeg;base64,", 10, 100, "1"),
        new Product("Paleta fresa", "data:image/jpeg;base64,", 10, 100, "2"),
        new Product("Paleta fresa", "data:image/jpeg;base64,", 10, 100, "3"),
        new Product("Paleta fresa", "data:image/jpeg;base64,", 10, 100, "4"),
        new Product("Paleta fresa", "data:image/jpeg;base64,", 10, 100, "5"),
    ],
    reducers: {
        getProducts: (state, action) => {},
    }
});

export const getProducts = stockSlice.actions.getProducts;

export default stockSlice.reducer;